import React from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';

const App = () => {
  const addNote = (note) => {
    alert('I am Clicked');
  };
  return (
    <div>
      <Header/>
    <CreateNote
     passNote={addNote}/>
      <Note/>
      <Footer/>
    </div>
  );
};

export default App;
